INSERT INTO `tickets_response` VALUES (35,17,'\"Caro jogador, muito obrigado por seu report, porm com a foto que voc n~os enviou, no da pra ter certeza da localizao exata do spot citado, teria como mandar uma foto mais precisa do ponto do bug? estaremos no aguardo.\"','staff',1681245704,NULL,'Marcus'),(36,17,'\"Vocs nunca entendem nada, Cip lixo!\"','user',1681245756,NULL,NULL),(37,17,'\"o problema  que sua foto mostra a entrada da caverna,\\n e no o local com o bug, e somos a HarpySoft, por \\nisso estamos solicitando uma outra imagem para nos\\n ajudar a solucionar o problema, se fosse a cip j \\nteria fechado o ticket =]\\n\"','staff',1681245874,NULL,'Marcus'),(38,17,'\"\"','user',1681246185,NULL,NULL),(39,17,'\"obrigado por sua resposta, com essas informaes nosso\\n time j identificou o bug, e o mesmo foi corrigido, a \\natuallizao vai subir junto com o prximo testServer,\\n obrigado pelo seu contato, este ticket est solucionado\\n e sendo fechado.\\n\"','staff',1681246261,NULL,'Marcus'),(40,18,'\"ok, we gonna teste it, thanks you, ticket closed\"','staff',1681316938,NULL,'Marcus');
